class Flair{
    #_source = undefined;
    constructor(element){
		if(element == null || element == "")
			element = undefined;
        if (element!==undefined)
            this.source = element; 
        this.createFlair(element);
        this.recalculate(element);
    }
    set source(element){
        this.#_source = element;
    }
    get source(){
        return this.#_source;
    }
    recalculate(element){
		if(element===undefined && this.#_source !== undefined)
			element = this.#_source;
		
		this.flairExtraSmallWUnit1_00= new wUnit(1, 0, element);
		this.flairExtraSmallHUnit1_00= new hUnit(1, 0, element);
		this.flairSmallWUnit1_00= new wUnit(1, 1, element);
		this.flairSmallHUnit1_00= new hUnit(1, 1, element);
		this.flairMediumWUnit1_00= new wUnit(1, 2, element);
		this.flairMediumHUnit1_00= new hUnit(1, 2, element);
		this.flairLargeWUnit1_00= new wUnit(1, 3, element);
		this.flairLargeHUnit1_00= new hUnit(1, 3, element);
		this.flairExtraLargeWUnit1_00= new wUnit(1, 4, element);
		this.flairExtraLargeHUnit1_00= new hUnit(1, 4, element);
    }
    createFlair(source){
        let flaircontainer = document.createElement(`div`);
        flaircontainer.id = `flair-container`;
		flaircontainer.class = `flair-container`;
        
        let extrasmallcanvas = document.createElement(`canvas`);
		let imageXS = new Image();
        imageXS.src = extraSmallFlairBlockCode;
		if(!imageXS.complete || imageXS.naturalWidth<=0 || imageXS.naturalHeight<=0)
		{
			createFlair(source);
			return;
		}
        extrasmallcanvas.width = window.innerWidth;
        extrasmallcanvas.height = window.innerWidth*imageXS.naturalHeight/imageXS.naturalWidth;
        extrasmallcanvas.getContext("2d").drawImage(imageXS, 0, 0);
		
		let smallcanvas = document.createElement(`canvas`);
		let imageS = new Image();
        imageS.src = smallFlairBlockCode;
		if(!imageS.complete || imageS.naturalWidth<=0 || imageS.naturalHeight<=0)
		{
			createFlair(source);
			return;
		}
        smallcanvas.width = window.innerWidth;
        smallcanvas.height = window.innerWidth*imageS.naturalHeight/imageS.naturalWidth;
        smallcanvas.getContext("2d").drawImage(imageS, 0, 0);
        
        let mediumcanvas = document.createElement(`canvas`);
        let imageM = new Image();
        imageM.src = mediumFlairBlockCode;
		if(!imageM.complete || imageM.naturalWidth<=0 || imageM.naturalHeight<=0)
		{
			createFlair(source);
			return;
		}
        mediumcanvas.width = window.innerWidth;
        mediumcanvas.height = window.innerWidth*imageM.naturalHeight/imageM.naturalWidth;
        mediumcanvas.getContext("2d").drawImage(imageM, 0, 0);
    
        let largecanvas = document.createElement(`canvas`);
        let imageL = new Image();
        imageL.src = largeFlairBlockCode;
		if(!imageL.complete || imageL.naturalWidth<=0 || imageL.naturalHeight<=0)
		{
			createFlair(source);
			return;
		}
        largecanvas.width = window.innerWidth;
        largecanvas.height = window.innerWidth*imageL.naturalHeight/imageL.naturalWidth;
        largecanvas.getContext("2d").drawImage(imageL, 0, 0);
		
		let extralargecanvas = document.createElement(`canvas`);
        let imageXL = new Image();
        imageXL.src = extraLargeFlairBlockCode;
		if(!imageXL.complete || imageXL.naturalWidth<=0 || imageXL.naturalHeight<=0)
		{
			createFlair(source);
			return;
		}
        extralargecanvas.width = window.innerWidth;
        extralargecanvas.height = window.innerWidth*imageXL.naturalHeight/imageXL.naturalWidth;
        extralargecanvas.getContext("2d").drawImage(imageXL, 0, 0);
    
		let extrasmallflairblockElement = document.createElement(`img`);
        extrasmallflairblockElement.src = extrasmallcanvas.toDataURL();
        extrasmallflairblockElement.id = `flair-extra-small`;
        extrasmallflairblockElement.alt = `flairextrasmallblock`;
        flaircontainer.append(extrasmallflairblockElement);
        let smallflairblockElement = document.createElement(`img`);
        smallflairblockElement.src = smallcanvas.toDataURL();
        smallflairblockElement.id = `flair-small`;
        smallflairblockElement.alt = `flairsmallblock`;
        flaircontainer.append(smallflairblockElement);
        let mediumflairblockElement = document.createElement(`img`);
        mediumflairblockElement.src = mediumcanvas.toDataURL();
        mediumflairblockElement.id = `flair-medium`;
        mediumflairblockElement.alt = `flairmediumblock`;
        flaircontainer.append(mediumflairblockElement);
        let largeflairblockElement = document.createElement(`img`);
        largeflairblockElement.src = largecanvas.toDataURL();
        largeflairblockElement.id = `flair-large`;
        largeflairblockElement.alt = `flairlargeblock`;
        flaircontainer.append(largeflairblockElement);
		let extralargeflairblockElement = document.createElement(`img`);
        extralargeflairblockElement.src = extralargecanvas.toDataURL();
        extralargeflairblockElement.id = `flair-extra-large`;
        extralargeflairblockElement.alt = `flairextralargeblock`;
        flaircontainer.append(extralargeflairblockElement);
		
        if (source===undefined)
            source = document.body;
		else
        {
			flaircontainer.classList.add("flair-container-override"); 
		}
        source.prepend(flaircontainer);
    }
}
class wUnit{
    #_value;
    #_type;
    #_source;
    constructor(ratio, type, element){
		if(element == null || element == "")
			element = undefined;
        let source_element;
        this.type = type;
        if (element===undefined)
		{
            this.source = document.body;
			source_element = document.documentElement;
		}
        else
		{
            this.source = element;
			source_element = this.#_source;
		}
		this.source.querySelector("#flair-container").style.display = "block";
        this.value = ratio;
		this.source.querySelector("#flair-container").style.display = "none";
		if(this.#_type == 0)
            source_element.style.setProperty("--xswunit"+ parseFloat(ratio).toFixed(2).toString().replace(".","_"), this.#_value + "px");
        else if(this.#_type == 1)
            source_element.style.setProperty("--swunit"+ parseFloat(ratio).toFixed(2).toString().replace(".","_"), this.#_value + "px");
        else if(this.#_type == 2)
            source_element.style.setProperty("--mwunit"+ parseFloat(ratio).toFixed(2).toString().replace(".","_"), this.#_value + "px");
        else if(this.#_type == 3)
            source_element.style.setProperty("--lwunit"+ parseFloat(ratio).toFixed(2).toString().replace(".","_"), this.#_value + "px");
		else if(this.#_type == 4)
            source_element.style.setProperty("--xlwunit"+ parseFloat(ratio).toFixed(2).toString().replace(".","_"), this.#_value + "px");
    }
    set value(ratio){
		if(this.#_type == 0)
            this.#_value = this.source.querySelector("#flair-container").querySelector("#flair-extra-small").clientWidth * ratio;
        else if(this.#_type == 1)
            this.#_value = this.source.querySelector("#flair-container").querySelector("#flair-small").clientWidth * ratio;
        else if(this.#_type == 2)
            this.#_value = this.source.querySelector("#flair-container").querySelector("#flair-medium").clientWidth * ratio;
        else if(this.#_type == 3)
            this.#_value = this.source.querySelector("#flair-container").querySelector("#flair-large").clientWidth * ratio;
		else if(this.#_type == 4)
            this.#_value = this.source.querySelector("#flair-container").querySelector("#flair-extra-large").clientWidth * ratio;
    }
    set source(element){
        this.#_source = element;
    }
    get value(){
        return this.#_value;
    }
    set type(type){
        this.#_type = type;
    }
    get type(){
        return this.#_type;
    }
    get source(){
        return this.#_source;
    }
}
