var flair;
function flairReady(recall){
if (document.readyState!='loading') recall();
else if (document.addEventListener) document.addEventListener('DOMContentLoaded', recall);
else document.attachEvent('onreadystatechange', function(){
    if (document.readyState=='complete') recall();
});}
function run(){
    let flairscript = document.getElementById('flair_framework_script');
	let flairelement;
	if(flairscript != null)
	{
		let flairelementid = flairscript.getAttribute("source_id");
		flairelement = document.getElementById(flairelementid);
	}
	else
		flairelement = undefined;
    flair = new Flair(flairelement);
    flair.recalculate(flair.source);
}
window.addEventListener('resize', function(){flair.recalculate(flair.source);});
window.addEventListener('load', function(){flair.recalculate(flair.source);});
